import React from "react";

function Blog({ blog }) {
  if (!blog) return null;
  return (
    <section style={{ padding: "20px" }}>
      <h2>Blog</h2>
      {blog.map((b, i) => (
        <div key={i} style={{ marginBottom: "10px" }}>
          <h4>{b.title}</h4>
          <p>{b.summary}</p>
        </div>
      ))}
    </section>
  );
}

export default Blog;
